css:
@-moz-document domain("youtube.com") {
yt-icon [fill*="#FF0000"],
yt-icon [fill*="#F00"],
yt-icon [fill*="red"] {
    fill: var(--yt-spec-wordmark-text)
}

.yt-icon [fill*="white"],
.yt-icon [fill*="#fff"],
.yt-icon [fill*="#FAFAFA"],
.yt-icon[fill*="#FFF"],
.yt-icon[fill*="#FFFFFF"] {
    fill: var(--yt-spec-brand-background-primary) !important
}
}
